import React, { useState } from "react";
import "./condition_select.css";

function ConditionSelectScreen({ onStart }) {

  return (
    <div className="intro-container">
      <div className="intro-box">
        <h1 className="intro-title">
          Which condition are you assigned to?
        </h1>
        <button
          className="condA-button"
          onClick={() => window.location.assign("/#/ai_instruction")}
        >
          Conditon A
        </button>

        <button
          className="condB-button"
          onClick={() => window.location.assign("/#/no_ai_instruction")}
        >
          Conditon B
        </button>
      </div>
    </div>
  );
}

export default ConditionSelectScreen;
